import React from "react";
import { Col, Row } from "react-bootstrap";
const Header = () => {
    return (
        <div>
            <Row>
                <Col lg={2}>
                    <div>1</div>
                </Col>
                <Col lg={8}>
                    <div>2</div>
                </Col>
            </Row>
        </div>
    );
};

export default Header;
